# drugbank frequency
pwd = '/home/yangzaifei/DDI/KnowDDI-codes/data/drugbank/'
files = ['train.txt','valid.txt','test.txt']
cnt = {}
for i in range(86):
    cnt[i]=0
for fi in files:
    f = open(pwd+fi,'r')
    for line in f:
        r = int(line.strip().split()[2])
        cnt[r]+=1

sorted_cnt = sorted(cnt.items(), key = lambda kv:(kv[1], kv[0]))   
label = [pair[0] for pair in sorted_cnt]
value = [pair[1] for pair in sorted_cnt]
label.reverse()
value.reverse()

fig = plt.figure(figsize=(20,8))
rect1=plt.bar(np.arange(len(value)), [num for num in value])
plt.ylabel('frequency')
plt.xticks(np.arange(len(label)),label)
plt.tight_layout()
plt.savefig('drugbank_frequencys.png',dpi=300)

